import React, { useState } from "react";
import './login.css'
import Contact_list from "./contact_list_app";

const Login = () =>{
    const [log, setlog] = useState(false);
    const check = () =>{
        setlog(true);
        // <Contact_list />
    }

    return(
        <div className="Container">
            <div className="box">
                <h1>  LOG IN  </h1>
                <label>
                    <b>Email or Phone No.</b>
                </label><br></br>
                <input type="text" placeholder="Enter you mail/Phone no."></input><br></br>
                <label>
                    <b>Password</b>
                </label><br></br>
                <input type="password" placeholder="Enter you password."></input><br></br>

                <button title="SUBMIT" onClick={check}>Login In</button>

                <h3>Don't have an account <a href="www.google.com">Sign In</a></h3>
                <p>--------------------OR-------------------</p>

                <h2><a href="www.google.com">Login via google</a></h2>
                <h2><a href="www.facebook.com">Login via facebook</a></h2>
                { log && <Contact_list/> }
            </div>
        </div>
    )
}

export default Login
